import React, { Component } from "react";
import "./index.css";

export default class List extends Component {
  render() {
    return (
      <div className="row">
        {this.props.users.map((userObj) => {
          return (
            <div className="card">
              <a
                rel="noreferrer"
                href="http://github.com/reactjs"
                target="_blank"
              >
                <img
                  src="http://avatars.githubusercontent.com/u/6412038?v=3"
                  style={{ width: "100px" }}
                />
              </a>
              <p className="card-text">React</p>
            </div>
          );
        })}
      </div>
    );
  }
}
